import React from "react";

function Item(props) {

  return (
    <div className="Item">
    <td><img src={props.item}/></td>
    <td>{props.name}</td>
    <td>{props.price}</td>
    <td><input type="checkbox"></input></td>
    </div>
  );
}

export default Item;
